const Countries = () => {
  const countriesResults = [
    { name: 'Portugal', language: 'Portuguese' },
    { name: 'Spain', language: 'Spanish' },
    { name: 'France', language: 'French' }
  ]

  return (
    <ul>
      {countriesResults.map((item) => (
        <li>
          <h3>{item.name}</h3>
          <p>{item.language}</p>
        </li>
      ))}
    </ul>
  );
};

export default Countries;
